import React from "react"

function PrikazSvihKorisnika(props){
    const drugaUloga = props.user.authorities === "user " ? "admin ":"user "
    return(
            <tr>
                <td>{props.user.korisnickoIme}</td>
                <td>{props.user.datumRegistracije}</td>
                <td style={{textAlign: "center"}}>{props.user.authorities}</td>
                <td style={{textAlign: "center"}}><button onClick={props.handleClick} name={props.user.korisnickoIme}>Info</button></td>
            </tr>
    )
}

